import React, {Component, createElement} from 'react';
//import '../components/Songs/SongStyle/SongStyle.css';
import Header from '../components/Header/Header';
import SongList from '../components/Songs/SongList'
import Axios from 'axios';
import LinkButton from '../components/Properties/LinkButton';
import '../Styles/PropStyles/LinkButton.css';

class Songs extends Component{



    render(){
        return(
            <div>
                <Header/>
                <LinkButton classButton = 'LinkButton' ref = '/addsong' classRef = 'ButtonRef' text = 'add song'/>
                <SongList/>
            </div>
        );
    }
}

export default Songs;
